function Break({ breakDuration, setBreakDuration, addSub }) {
  switch (breakDuration) {
    case breakDuration < 15 && addSub === "add":
      setBreakDuration(breakDuration + 1);
      break;
    case 1 < breakDuration && addSub === "sub":
    default:
      setBreakDuration(breakDuration - 1);
  }
  return breakDuration;
}

export { Break };
